import { style } from "typestyle";

const HomeHowItWorkStyle = style({
    // backgroundColor: 'red',
    height: '80vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    $nest: {
        '& .title': {
            $nest: {
                '& span': {
                    fontFamily: 'GothamLight'
                },
            }
        },
        '& .circle': {
            height: '150px',
            textAlign: 'center',
            width: '150px',
            borderRadius: '50%',
            backgroundColor: 'red',

        }
    }
})

export default HomeHowItWorkStyle
